import "./App.css";
import Header from "./components/Header";
import Body from "./components/Body";
import Footer from "./components/Footer";

function App() {
  return (
    <>
      <Header
        className="header"
        style={{ backgroundColor: "#E5E5E5", height: "100%" }}
      />
      <Body className="body" />
      <Footer className="footer" />
    </>
  );
}

export default App;
